import React from 'react';
import Dialog from './functional/Dialog.js';
import getKey from './utils/KeyGenerator.js';
import shakaBlack from '../assets/images/shakaBlack.png';
import thumbsUp from '../assets/images/ThumbsUp.png';
import thumbsDown from '../assets/images/ThumbsDown.png';
import {BrowserRouter as Router, Switch, Link, Route} from 'react-router-dom';

class LogDirectory extends React.Component {

    postDirectory = (localStorage.getItem("postDirectory") === null) ? [] : JSON.parse(localStorage.getItem("postDirectory"));
    postDirectory = (localStorage.getItem("postDirectory") === null) ? [] : JSON.parse(localStorage.getItem("postDirectory"));

    constructor(props) {
        super(props);
        this.title = props.title;
        this.message = props.message;
        this.sessionClick = this.sessionClick.bind(this);
    }
    sessionClick(item) {
        console.log(`sessionClick --> ${item}`);
    }
    months = ["Jan", "Feb", "Mar", "Apr", "May", "Jun", "Jul", "Aug", "Sept", "Oct", "Nov", "Dec"]
    suffix = ["th", "st", "nd", "rd", "th", "th", "th", "th", "th", "th", "th"];
    icons = [shakaBlack, thumbsUp, thumbsDown];
    conditions = ["Firing", "Good", "Bad"];
    items = () => this.postDirectory;
    logEntry = (logId) => {
        if (localStorage.getItem(logId) === null) {
          console.log(`${logId} is null`);
          return false;
        }
        return JSON.parse(localStorage.getItem(logId));
    }
    break = (logId) => (this.logEntry(logId) === false) ? <span className="bold color-yellow"></span> : <span className="bold color-yellow">BREAK: {this.logEntry(logId).Location.Break}</span>;
    day = (logId) => (this.logEntry(logId) === false) ? <span className="bold color-yellow"></span> : <span className="bold color-yellow">DAY: {this.logEntry(logId).Day.Day}</span>;
    month = (logId) => (this.logEntry(logId) === false) ? <span className="bold color-yellow"></span> :  <span className="bold color-yellow">MONTH: {this.months[this.logEntry(logId).Day.Month-1]}</span>;
    year = (logId) => (this.logEntry(logId) === false) ? <span className="bold color-yellow"></span> : <span className="bold color-yellow">YEAR: {this.logEntry(logId).Day.Year}</span>;
    conditionDescription = (logId)  => (this.logEntry(logId) === false) ? <span className="bold color-yellow"></span> : <span className="bold color-yellow">CONDITIONS: {this.logEntry(logId).Conditions.Conditions}</span>;
    condition = (logId) => this.icons[this.conditions.indexOf(this.conditionDescription(logId))];

    sessions = () => this.items().map((item) => {
        return <Link to={{
            pathname: '/SurfLog',
            state: {
              logId: {item}
            }
          }}>
            <div key={getKey("log")} className="flexContainer button pointer greet m-1 r-10 completedSelector bg-green" onClick={() => this.sessionClick(item)}>
                    <div className="flexOneFourthColumn p-10">
                        "'" + {JSON.stringify(this.condition(item))} + "'" +
                    </div>
                    <div className="flexThreeFourthColumnLeft pt-10 pb-10">
                        {this.month(item) + " " + this.day(item) + this.suffix[Number(String(this.day(item)).slice(-1))] /*+ " " + this.year(item)*/ + ": "}
                        <br/>{this.break(item)}
                    </div>
                        {
                            //item.substring(3, 6) + ", " + 
                            //item.substring(6, item.indexOf("20")) + " " + 
                            //item.substring(item.indexOf("20"), item.indexOf("20")+4) + " " + 
                            //item.substring(item.length-2, item.length) + 
                        }
            </div>
        </Link>
    })
    render() {
        return (
            <div className="App-content fadeIn">
                <Dialog title="Log Directory" message="Review sessions">
                    {this.sessions()}
                </Dialog>
            </div>
        );
    };
}

export default LogDirectory;
